const Profile = (props) => {
    const [className, setClassName] = useState("profile");
    return (
        <div
            className={className}
            onMouseOver={() => setClassName("profile-hover")}
            onMouseLeave={()=> setClassName}
        >
            {props}
        </div>
    )
}

export default Profile
